				{
					proveedores.map((prov) => {
						return ( 
							<li key={ prov.link }>
								<a href={'#${ prov.link }'}>
									<span className="nombre">{ prov.nombre }</span>
									<span className="dcto">{ prov.dcto }</span>
								</a>
							</li> 
						);
					})
				}
			</ul>
		</section>
	);
}

export default Map;
